import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { GoogleMap, LoadScript, Autocomplete } from '@react-google-maps/api'; // Importing GoogleMap, LoadScript, and Autocomplete
import MapContainer from '../components/MapContainer'; // Importing the MapContainer component
import '../styles/BookingPage.css'; // Importing the BookingPage.css for styling

const BookingPage = () => {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    pickupLocation: '',
    deliveryLocation: '',
    vehicleDetails: {
      registration: '',
      type: '',
      weight: '',
    },
  });

  const [pickupAutocomplete, setPickupAutocomplete] = useState(null); // Autocomplete for pickup location
  const [deliveryAutocomplete, setDeliveryAutocomplete] = useState(null); // Autocomplete for delivery location

  // Handle form input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form Submitted:', formData);
    // Add further actions such as API calls or form processing here
  };

  // Handle place selection for pickup and delivery locations
  const handlePickupPlaceChange = () => {
    if (pickupAutocomplete) {
      const place = pickupAutocomplete.getPlace();
      if (place.formatted_address) {
        setFormData((prevData) => ({
          ...prevData,
          pickupLocation: place.formatted_address,
        }));
      }
    }
  };

  const handleDeliveryPlaceChange = () => {
    if (deliveryAutocomplete) {
      const place = deliveryAutocomplete.getPlace();
      if (place.formatted_address) {
        setFormData((prevData) => ({
          ...prevData,
          deliveryLocation: place.formatted_address,
        }));
      }
    }
  };

  return (
    <div className="booking-page">
      <h1 className="page-header">Book Your Car Recovery Service</h1>

      {/* Booking Form */}
      <form className="booking-form" onSubmit={handleSubmit}>
        <h2>Booking Details</h2>

        <label htmlFor="name">Your Name</label>
        <input
          type="text"
          id="name"
          name="name"
          value={formData.name}
          onChange={handleChange}
          placeholder="Enter your full name"
          required
        />

        <label htmlFor="phone">Your Phone Number</label>
        <input
          type="tel"
          id="phone"
          name="phone"
          value={formData.phone}
          onChange={handleChange}
          placeholder="Enter your phone number"
          required
        />

        {/* Pickup Location Autocomplete */}
        <label htmlFor="pickupLocation">Pickup Location</label>
        <LoadScript googleMapsApiKey="YOUR_GOOGLE_API_KEY" libraries={['places']}>
          <Autocomplete
            onLoad={(autocomplete) => setPickupAutocomplete(autocomplete)}
            onPlaceChanged={handlePickupPlaceChange}
          >
            <input
              type="text"
              id="pickupLocation"
              name="pickupLocation"
              value={formData.pickupLocation}
              onChange={handleChange}
              placeholder="Enter pickup location"
              required
            />
          </Autocomplete>
        </LoadScript>

        {/* Delivery Location Autocomplete */}
        <label htmlFor="deliveryLocation">Delivery Location</label>
        <LoadScript googleMapsApiKey="AIzaSyBoyZ1H81_TBDC_m0I8gyGykfLfRN5IdFY" libraries={['places']}>
          <Autocomplete
            onLoad={(autocomplete) => setDeliveryAutocomplete(autocomplete)}
            onPlaceChanged={handleDeliveryPlaceChange}
          >
            <input
              type="text"
              id="deliveryLocation"
              name="deliveryLocation"
              value={formData.deliveryLocation}
              onChange={handleChange}
              placeholder="Enter delivery location"
              required
            />
          </Autocomplete>
        </LoadScript>

        <h3>Vehicle Details</h3>
        <label htmlFor="registration">Vehicle Registration</label>
        <input
          type="text"
          id="registration"
          name="registration"
          value={formData.vehicleDetails.registration}
          onChange={handleChange}
          placeholder="Enter vehicle registration number"
          required
        />

        <label htmlFor="type">Vehicle Type</label>
        <input
          type="text"
          id="type"
          name="type"
          value={formData.vehicleDetails.type}
          onChange={handleChange}
          placeholder="Enter vehicle type (e.g., SUV, Sedan)"
          required
        />

        <label htmlFor="weight">Vehicle Weight (Kg)</label>
        <input
          type="number"
          id="weight"
          name="weight"
          value={formData.vehicleDetails.weight}
          onChange={handleChange}
          placeholder="Enter vehicle weight"
          required
        />

        <button type="submit">Submit Booking</button>
      </form>

      {/* Display Map */}
      <div className="map-section">
        <MapContainer /> {/* This will render the MapContainer component with Google Map */}
      </div>

      <div className="booking-footer">
        <p>Need help? <Link to="/contact">Contact Us</Link></p>
        <p>For more details on services, visit our <Link to="/terms">Terms & Conditions</Link>.</p>
      </div>
    </div>
  );
};

export default BookingPage;
